////	Check if Ker is an maximal isotropic (3,3)-subgroup
Is_33_Subgroup := function( Ker )
	J := Parent(Ker[1]);
	//  Checking number of generators
	if #Ker ne 2 then;				return false;   end if;
	//  Checking order of generators
	if (3*Ker[1] ne J!0) then;			return false;   end if;
	if (3*Ker[2] ne J!0) then;			return false;   end if;
	if (Ker[1] eq J!0) then;			return false;   end if;
	if (Ker[2] eq J!0) then;			return false;   end if;
	//  Checking linear independence
	if (Ker[1] eq Ker[2]) then;			return false;   end if;
	if (Ker[1] eq 2*Ker[2]) then;			return false;   end if;
	//  Checking Weil pairing
	if WeilPairing( Ker[1], Ker[2], 3 ) ne 1 then;	return false;   end if;
	        
	return true;
end function;

////	Make a polynomial monic
MakeMonic := function( f )
	return f/LeadingCoefficient(f);
end function;

////	Obtains G, L, and H from a given curve and divisor of order 3.
////	G, L, H are defined in [BFT14]
GetGLH := function( C, D )
	P := MumfordToPT( D );
	K := Parent(P[1,1]);
	S<x,y,a,b,c,d> := PolynomialRing(K,6);
	Hf,_ := HyperellipticPolynomials(C);
	R := Parent(Hf);
	f := a*x^3 + b*x^2 + c*x + d - y;
	df := 3*a*x^2 + 2*b*x + c;
	dHf := Derivative(Hf);
	
	E1 := Evaluate( f, [ P[1,1], P[1,2], a,b,c,d ] );
	E2 := Evaluate( f, [ P[2,1], P[2,2], a,b,c,d ] );
	E3 := Evaluate( df, [ P[1,1], P[1,2], a,b,c,d ] ) - Evaluate(dHf,P[1,1])/(2*P[1,2]);
	E4 := Evaluate( df, [ P[2,1], P[2,2], a,b,c,d ] ) - Evaluate(dHf,P[2,1])/(2*P[2,2]);

	////	Solve using Grobner bases...
	////	GroebnerBasis([E1,E2,E3,E4]);
	
	A := Matrix( K, 4,4, [	Coefficient(E1,a,1), Coefficient(E1,b,1), Coefficient(E1,c,1), Coefficient(E1,d,1),
				Coefficient(E2,a,1), Coefficient(E2,b,1), Coefficient(E2,c,1), Coefficient(E2,d,1),
				Coefficient(E3,a,1), Coefficient(E3,b,1), Coefficient(E3,c,1), Coefficient(E3,d,1),
				Coefficient(E4,a,1), Coefficient(E4,b,1), Coefficient(E4,c,1), Coefficient(E4,d,1) ] );
	W := Vector( K, 4, [ TrailingCoefficient(E1), TrailingCoefficient(E2), TrailingCoefficient(E3), TrailingCoefficient(E4) ] );
	sol:=Solution(Transpose(A),-W);
	G := R!UnivariatePolynomial( Evaluate( f, [x,0] cat Eltseq(sol) ) );

	fac := Factorisation( G^2-Hf );
	if #fac eq 1 then;	return G, -LeadingCoefficient(G^2-Hf), fac[1,1];
	elif #fac eq 2 then;	return G, -LeadingCoefficient(G^2-Hf), fac[1,1]*fac[2,1];
	else			return 0;
	end if;
end function;

////	Obtains L and M given G, L, and H. These are defined in [BFT14].
GetLM := function( G1, G2, H1, H2, L1, L2 )
	////	Set up
	R<x> := Parent(H1);
	Rt := PolynomialRing(R); t := Rt.1;
	tpol := t^3-L2/L1;
	Rax<alp> := quo<Rt|tpol>;
	_<b0,b1,b2,d0,d1,d2> := PolynomialRing( R, 6 );

	LHS := H1-alp*H2;

	c2 := 0;
	c1 := Coefficients(Eltseq(LHS)[2])[3];
	c0 := Coefficients(Eltseq(LHS)[1])[3];

	GB := GroebnerBasis( [	b0*c0 + d0 + (L2/L1)*b2*c1 + (L2/L1)*b1*c2 - Coefficients(Eltseq(LHS)[1])[2],
				b1*c0 + b0*c1 + d1 - Coefficients(Eltseq(LHS)[2])[2],
				b0*d0 + (L2/L1)*b2*d1 + (L2/L1)*b1*d2 - Coefficients(Eltseq(LHS)[1])[1],
				b1*d0 + b0*d1 + (L2/L1)*b2*d2 - Coefficients(Eltseq(LHS)[2])[1],
				b2*c0 + b1*c1 + d2, b2*d0 + b1*d1 + b0*d2 ] );

	D2Roots := Roots(UnivariatePolynomial(GB[6]));
	for ind in [1..#D2Roots] do
		D2 := D2Roots[ind,1];
		D1 := Roots(UnivariatePolynomial(Evaluate(GB[5],[b0,b1,b2,d0,d1,D2])))[1,1];
		D0 := Roots(UnivariatePolynomial(Evaluate(GB[4],[b0,b1,b2,d0,D1,D2])))[1,1];
		B2 := Roots(UnivariatePolynomial(Evaluate(GB[3],[b0,b1,b2,D0,D1,D2])))[1,1];
		B1 := Roots(UnivariatePolynomial(Evaluate(GB[2],[b0,b1,b2,d0,d1,D2])))[1,1];
		B0 := Roots(UnivariatePolynomial(Evaluate(GB[1],[b0,b1,b2,d0,D1,D2])))[1,1];
		C2 := c2;
		C1 := c1;
		C0 := c0;
	
		L := x + B0 + B1*alp + B2*alp^2;
		M := ( C0 + C1*alp )*x + D0 + D1*alp + D2*alp^2;
		if L*M ne (H1-alp*H2) then;		continue;	end if;
		if (G2-G1) mod Norm(M) ne 0 then;	continue;	end if;
		break;
	end for;

	return L, M;
end function;

////	Computes r,s,t as defined in [BFT14]
Get_rst := function( C_1, T_1 : DEBUG:=false )
	Hf,_ := HyperellipticPolynomials(C_1);
	K := BaseRing(C_1);

	////	Find G_1
	G1, lam1, H1 := GetGLH( C_1, T_1[1] );
	G2, lam2, H2 := GetGLH( C_1, T_1[2] );
	
	if DEBUG then;
		"Pre transformation checks:";
		Hf eq G1^2 + lam1*H1^3;
		Hf eq G2^2 + lam2*H2^3;
	end if;
	
	
	////	Adjust lambdas so that c = 1
	//	Get L and M, and c.
	L, M := GetLM( G1, G2, H1, H2, lam1, lam2 );
	Rax<alp> := Parent(L);
	
	c := K!(Norm(M)/(G2-G1));
	if DEBUG then;
		"First transformation checks:";
		(G2-G1) eq Norm(M)/c;
		(G2+G1) eq c*lam1*Norm(L);
	end if;
	
	//	Now that we have c, we need to perform a transformation
	//	to make it 1.
	C_2, phi_1 := Transformation( C_1, c );
	T_2 := [ Evaluate(phi_1, T_1[1]), Evaluate(phi_1, T_1[2]) ];
	G1_2, lam1_2, H1_2 := GetGLH( C_2, T_2[1] );
	G2_2, lam2_2, H2_2 := GetGLH( C_2, T_2[2] );
	L_2, M_2 := GetLM( G1_2, G2_2, H1_2, H2_2, lam1_2, lam2_2 );
	c_2 := K!(Norm(M_2)/(G2_2-G1_2));
	
	
	////	Now, we perform the second linear transformation
	
	l0 := -Eltseq( Eltseq(L_2)[1])[1];
	l1 := -Eltseq(L_2)[2];
	l2 := -Eltseq(L_2)[3];
	alp3 := lam2_2/lam1_2;
	
	C_3, phi_2 := Transformation(C_2,[l1,alp3*l2^2-l0*l1, l2, l1^2-l0*l2]);
	T_3 := [ Evaluate(phi_2, T_2[1]), Evaluate(phi_2, T_2[2]) ];
	G1_3, lam1_3, H1_3 := GetGLH( C_3, T_3[1] );
	G2_3, lam2_3, H2_3 := GetGLH( C_3, T_3[2] );
	L_3, M_3 := GetLM( G1_3, G2_3, H1_3, H2_3, lam1_3, lam2_3 );
	
	if #Eltseq(L_3) eq 2 then
		u := -Eltseq(L_3)[2];
	elif #Eltseq(L_3) eq 1 then
		u := 0;
	else
		"Uh ho..";
	end if;
	
	c0 :=  Coefficient(Eltseq(M_3)[1],1);
	m0 := -Coefficient(Eltseq(M_3)[1],0);
	c1 :=  Coefficient(Eltseq(M_3)[2],1);
	m1 := -Coefficient(Eltseq(M_3)[2],0);
	c2 :=  Coefficient(Eltseq(M_3)[3],1);
	m2 := -Coefficient(Eltseq(M_3)[3],0);
	
	if DEBUG then;
		"Second transformation checks:";
		M_3 eq ( c0 + c1*Parent(M_3).1 + c2*(Parent(M_3).1)^2 )*BaseRing(Parent(M_3)).1 - ( m0 + m1*Parent(M_3).1 + m2*(Parent(M_3).1)^2 );
		c2 eq 0;
		m1*u eq 0;
		-m2 eq c1*u;
	end if;
	
	s := lam1_3;
	t := lam1_3/s;
	
	////	On to the last series of transformations
	C_42, theta1 := Transformation( C_3,  [c0,0,0,1] );
	T_42 := [ Evaluate(theta1, T_3[1]), Evaluate(theta1, T_3[2]) ];
	G1_42, lam1_42, H1_42 := GetGLH( C_42, T_42[1] );
	G2_42, lam2_42, H2_42 := GetGLH( C_42, T_42[2] );
	L_42, M_42 := GetLM( G1_42, G2_42, H1_42, H2_42, lam1_42, lam2_42 );
	s := s*c0^3;
	t := t;
	
	C_41, theta2 := Transformation( C_42, [-c1,0,0,1] );
	T_41 := [ Evaluate(theta2, T_42[1]), Evaluate(theta2, T_42[2]) ];
	G1_41, lam1_41, H1_41 := GetGLH( C_41, T_41[1] );
	G2_41, lam2_41, H2_41 := GetGLH( C_41, T_41[2] );
	L_41, M_41 := GetLM( G1_41, G2_41, H1_41, H2_41, lam1_41, lam2_41 );
	s := s;
	t := t*(-c1)^3;
	
	C_4,  theta3 := Transformation( C_41, [1/u,0,0,1] );
	T_4 := [ Evaluate(theta3, T_41[1]), Evaluate(theta3, T_41[2]) ];
	G1_4, lam1_4, H1_4 := GetGLH( C_4, T_4[1] );
	G2_4, lam2_4, H2_4 := GetGLH( C_4, T_4[2] );
	L_4, M_4 := GetLM( G1_4, G2_4, H1_4, H2_4, lam1_4, lam2_4 );
	s := s;
	t := t;
	
	if #Eltseq(L_4) eq 2 then
		u := -Eltseq(L_4)[2];
	elif #Eltseq(L_4) eq 1 then
		u := 0;
	else
		"Uh ho..";
	end if;
	
	c0 :=  Coefficient(Eltseq(M_4)[1],1);
	m0 := -Coefficient(Eltseq(M_4)[1],0);
	c1 :=  Coefficient(Eltseq(M_4)[2],1);
	m1 := -Coefficient(Eltseq(M_4)[2],0);
	c2 :=  Coefficient(Eltseq(M_4)[3],1);
	m2 := -Coefficient(Eltseq(M_4)[3],0);
	
	if DEBUG then;
		"Third transformation checks:";
		c2 eq 0;
		m1*u eq 0;
		-m2 eq c1*u;
		c0 eq 1;
		c1 eq -1;
		u eq 1;
	end if;
	
	////	Last transformation to get c=1
	Rax<alp> := Parent(L_4);
	c := K!(Norm(M_4)/(G2_4-G1_4));
	
	C_5, phi_4 := Transformation( C_4, c );
	T_5 := [ Evaluate(phi_4, T_4[1]), Evaluate(phi_4, T_4[2]) ];
	G1_5, lam1_5, H1_5 := GetGLH( C_5, T_5[1] );
	G2_5, lam2_5, H2_5 := GetGLH( C_5, T_5[2] );

	L_5, M_5 := GetLM( G1_5, G2_5, H1_5, H2_5, lam1_5, lam2_5 );
	cc0 :=  Coefficient(Eltseq(M_5)[1],1);
	mm0 := -Coefficient(Eltseq(M_5)[1],0);
	cc1 :=  Coefficient(Eltseq(M_5)[2],1);
	mm1 := -Coefficient(Eltseq(M_5)[2],0);
	cc2 :=  Coefficient(Eltseq(M_5)[3],1);
	mm2 := -Coefficient(Eltseq(M_5)[3],0);

	ss := lam1_5/4;
	rr := Coefficient( H1_5, 1 );
	tt := Coefficient( H1_5, 0 );

	_<x> := Parent(G1_5);
	if DEBUG then;
		"'Last' transformation checks:";
		H1_5 eq x^2 + rr*x + tt;
		lam1_5 eq 4*ss;
		G1_5 eq (2*ss + 1/2*tt - 1/2)*x^3 + (-3/2*rr + 3/2*tt)*x^2 + (-3/2*rr^2 + 3/2*rr*tt)*x + (-1/2*rr^3 - 2*ss*tt + 1/2*tt^2);
		H2_5 eq x^2 + x + rr;
		lam2_5 eq 4*ss*tt;
		G2_5 eq (2*ss - 1/2*tt + 1/2)*x^3 + (3/2*rr - 3/2*tt)*x^2 + (3/2*rr^2 - 3/2*rr*tt)*x + (1/2*rr^3 - 2*ss*tt - 1/2*tt^2);
	end if;

	////	Last unsaid transformation
	C_6, phi_5 := Transformation( C_5, 1/(ss*2) );
	T_6 := [ Evaluate(phi_5, T_5[1]), Evaluate(phi_5, T_5[2]) ];
	G1_6, lam1_6, H1_6 := GetGLH( C_6, T_6[1] );
	G2_6, lam2_6, H2_6 := GetGLH( C_6, T_6[2] );
	L_6, M_6 := GetLM( G1_6, G2_6, H1_6, H2_6, lam1_6, lam2_6 );
	c0 :=  Coefficient(Eltseq(M_6)[1],1);
	m0 := -Coefficient(Eltseq(M_6)[1],0);
	c1 :=  Coefficient(Eltseq(M_6)[2],1);
	m1 := -Coefficient(Eltseq(M_6)[2],0);
	c2 :=  Coefficient(Eltseq(M_6)[3],1);
	m2 := -Coefficient(Eltseq(M_6)[3],0);
	Rax<alp> := Parent(L_6);
	c := K!(Norm(M_6)/(G2_6-G1_6));
		
	f6,_ := HyperellipticPolynomials(C_6);
	s := lam1_6/4;
	r := Coefficient( H1_6, 1 );
	t := Coefficient( H1_6, 0 );


	if DEBUG then
		"Final checks:";
		(c eq (2*ss)) and (m1*u eq 0) and (-m2 eq c1*u) and
		(c0 eq 1) and (c1 eq -1) and (c2 eq 0) and
		(m1 eq 0) and (m2 eq 1) and //(m0 eq -r) and
		(u eq 1);
		"(r,s,t) checks:";
		r eq Coefficient(H2_6,0) and lam2_6 eq 4*s*t;
		_<x> := Parent(G1_6);
		-G1_6 eq ( (-s*t + s - 1)*x^3 + (-3*s*t + 3*s*r)*x^2 + (-3*s*t*r + 3*s*r^2)*x - s*t^2 + s*r^3 + t);
		G2_6 eq ( (-s*t + s + 1)*x^3 + (-3*s*t + 3*s*r)*x^2 + (-3*s*t*r + 3*s*r^2)*x - s*t^2 + s*r^3 - t);
		return r,s,t,[H1_6,H2_6,lam1_6,lam2_6,G1_6,G2_6];
	end if;

	return r,s,t, [phi_1,phi_2,theta1,theta2,theta3,phi_4,phi_5];
end function;

rstToCrvHyp := function( r,s,t )
	_<x> := PolynomialRing(Parent(r));
	H := x^2 + r*x + t;
	lambda := 4*s;
	G := (-s*t + s - 1)*x^3 + (-3*s*t + 3*s*r)*x^2 + (-3*s*t*r + 3*s*r^2)*x - s*t^2 + s*r^3 + t;
	return HyperellipticCurve( G^2 + lambda*H^3 );
end function;

////	Now, we map! These equations are obtained from [BFT14]
Bo3Isogeny := function( KerTors )
	J := Parent(KerTors[1]);
	C := Curve(J);
	r,s,t,_ := Get_rst( C, KerTors );
	_<x> := PolynomialRing(BaseRing(C));
	Ht1:=(s^2*t^3 - 4*s^2*t^2*r + s^2*t^2 + 6*s^2*t*r^2 - 4*s^2*t*r + s^2*t - s^2*r^4 + 2*s*t^2 - 5*s*t*r + s*t + 3*s*r^2 - s*r + t - r)*x^2 + (s^2*t^3 - 3*s^2*t^2*r^2 + s^2*t^2*r - s^2*t^2 + 6*s^2*t*r^3 - 5*s^2*t*r^2 + 2*s^2*t*r - s^2*r^5 + 2*s*t^2 - 4*s*t*r^2 + s*t*r - s*t + 3*s*r^3 - s*r^2 + t - r^2)*x - s^2*t^3*r + s^2*t^3 + 2*s^2*t^2*r^2 - 2*s^2*t^2*r - s^2*t*r^3 + s^2*t*r^2 - 2*s*t^2*r + 2*s*t^2 + 2*s*t*r^2 - 2*s*t*r - t*r + t;
